Text:
@Enita aka MiSO aka iNCET aka Candy86 har redan denna text och försöker ljuga folk gul och blå på swesub.nu att det är han som översätter den.
Det spelar ingen roll om han fick den av Starchild eller inte, faktumet är att han ljuger om allt även om hans release vika han stjäl från andra

Denna tackar vi  Starchild666 för och hoppas han inte ger bort fler texter till den lögnaren utan bara laddar upp den så andra får tillgång till den
